var input = document.querySelector('#autocomplete');
var autocomplete = document.querySelector('.nav-primary-search__autocomplete ul');
var links = autocomplete.getElementsByTagName('a');

  function buildList(matches){
    var html = '';
    for(var i = -1;++i<matches.length;){
      var onClass = '';
      if(i===0){
        onClass = 'nav-primary-search__autocomplete-link-selected';
      };


      if(matches[i].error === true){
        html = "<li>NO MATCHES</li>";
      }
      else {
      html += '<li class="nav-primary-search__autocomplete-item"><a class="'+onClass+' nav-primary-search__autocomplete-link" href="'+matches[i].itemLink+'">' + matches[i].t + '<br><small>' +  matches[i].itemLabel + '</small></a></li>';
    }
    }

    autocomplete.innerHTML = html;


  }


  var matches = [];
  input.addEventListener('keyup', function(e){
    if(e.keyCode > 36 && e.keyCode < 41){
      return;
    }

    if(e.keyCode === 13){
      var selected = autocomplete.querySelector('.nav-primary-search__autocomplete-link-selected');
      if(selected){
        location.href = selected.href;
        return;
      }
    }

    matches = [];
    var searchTerm = e.target.value;
    if(searchTerm.length < 1){
      buildList([]);
      return;
    }

    for(var i = -1;++i<searchTerms.terms.length;){
      var t = searchTerms.terms[i];
      var regex = new RegExp('^' + searchTerm + '', 'i');
      if(t.t.match(regex)){
        matches.push(t);
      }

    }
    if(matches.length){
    buildList(matches);
  }
  else {
    buildList([{t:'NO MATCHES', error:true}])
  }
  }, false);

  input.addEventListener('keydown', function(e){

     if(e.keyCode !== 38 && e.keyCode !== 40){
      return;
     }

     var visibleItems = [];
     for(var i = -1;++i<links.length;){
      if(links[i].offsetWidth){
        visibleItems.push(links[i])
      }
     }

    var iterator = 1;
    var reset = 0;

    if(e.keyCode === 38){
      iterator = -1;
      reset = visibleItems.length - 1;
    }


       for(var i = -1;++i<visibleItems.length;){

        if(visibleItems[i].classList.contains('nav-primary-search__autocomplete-link-selected')){
          visibleItems[i].classList.remove('nav-primary-search__autocomplete-link-selected');
          if(visibleItems[i + iterator]){
            visibleItems[i + iterator].classList.add('nav-primary-search__autocomplete-link-selected');
          }
          else {
            visibleItems[reset].classList.add('nav-primary-search__autocomplete-link-selected');
          }
          break;
        }
      }

  })
